import React from 'react';
import './App.css';
import Todos from './components/Todos';


function App() {

  const state = {
    todos:[
      {
        id:1,
        title:"Take out trash",
        completed:false
      },{
        id:2,
        title:"Wash car",
        completed:true
      },{
        id:3,
        title:"Cook Food",
        completed:false
      },{
        id:4,
        title:"Book Train",
        completed:true
      }
    ]
  }


  function markComplete (){
    console.log('From App Js')
  }

  return (
    <div className="App">
      <header className="App-header">
        <Todos todos={state.todos}  markComplete={this.markComplete} />
      </header>
    </div>
  );
}

export default App;
